(3188,1,277,131,'1. Looking at Hannah\'s situation, I would like to change my answer to Week 4 from social loafing to equal participation--actually I can\'t at this moment:/\r\n2. Although I clearly see (from the writer\'s perspective) that Iain is trying to avoid gauged tasks from this group work, but at the end, everyone got a similar amount of tasks to be done.','2019-05-23 05:16:57','2019-05-23 05:16:57',''),
(3189,4,277,132,'Although I choose social loafing due to Iain\'s clear under-contribution to the group work, I see another problem either. As a person who value constant communication within the group to let every members acknowledges what each member is contributing, the writer should tell and assure others to know exactly what the writer is doing. Without sufficient communications on the working progress, something is very likely to go wrong at some point. e.g. doing overlapped tasks, making progress to the wrong direction, et cetera.','2019-05-23 05:29:57','2019-05-23 05:29:57',''),
(3190,1,277,133,'At this week, I support Hannah\'s opinion that Iain actually did a lot before to help her when Hannah could not contribute to the group work that much. So I choose equal participation as of Week 7. \r\nMeanwhile, I see a \'red flag\' among the group members--they do not trust their teammates and underestimate the others\' contributions. I am concerned about that this may result in severe conflicts in the future.','2019-05-23 05:50:34','2019-05-23 05:50:34',''),
(3191,4,277,134,'Now, I would say social loafing to Iain as he does not seem to participate in the group project actively but rather, he seems satisfied to being at the group meeting and no extra work outside of the meeting.\r\nThe other thing I see is the work with the writer and John. I am worried that they are not actually putting their best efforts due to some sort of depression (at least I guess) from social loafing in the group work.','2019-05-23 05:57:52','2019-05-23 05:57:52',''),
(3192,4,277,135,'I see clear social loafing of Iain that he does not actually contribute to the group project, while other members are roughly equally contributing to it.','2019-05-23 06:04:13','2019-05-23 06:04:13',''),
(3193,4,277,136,'','2019-05-23 07:27:15','2019-05-23 07:27:15',''),
(3194,1,277,137,'I would say equal participation for this week as everyone at the end participated and prepared their presentations well. The other point is that there was a conflict exploded at this week, which has lasted for few weeks. Although this does not directly affect the equal participation, it may affect to overall quality of group work as it downgrades cooperation.','2019-05-23 07:43:15','2019-05-23 07:43:15',''),
(3195,3,277,138,'I think it is more like group domination by the writer--she actually devalue Iain\'s feedback although she forced him to give some while she still complains about his laziness. Although she may have the right view, it is also clear that complaints toward a certain team member is not helpful to progress the group project at all.','2019-05-23 07:48:25','2019-05-23 07:48:25',''),
(3196,6,277,139,'I think Iain\'s act at the presentation can be group domination as he deliberately did everything without giving a chance for other teammates to answer, forcing his opinion as if it were the team\'s opinion (although I cannot sure he did right or wrong at the Q&A session). For the attire problem, it was lack of communication, which I believe it was partly due to unfriendly atmosphere within the team because of conflicts. I see social loafing as Iain does not participate in revising the final report while other teammates are all engaged in and I doubt whether it is right decision to only participate in the presentation well and giving none of attention to the report.','2019-05-23 08:00:15','2019-05-23 08:00:15','Group domination and social loafing at the same time:('),
(3197,1,277,140,'Although there were clearly emotional unpleasantness, it ended with equal participation to the group project.','2019-05-23 08:02:31','2019-05-23 08:02:31',''),
